const Home = () => {
  const handleClick = (e) => {
    console.log("button clicked", e.target);
  };

  const handleClickAgain = (name) => {
    console.log(`button again cliked with ${name}`);
  };

  return (
    <div className="home">
      <h1>Homepage</h1>
      <button onClick={handleClick}>Click me</button>
      <button onClick={() => handleClickAgain("rejish")}>Click me again</button>
    </div>
  );
};

export default Home;
